import { Box, SxProps, Theme } from "@mui/material";

export const Header = () => {
  return (
    <Box className="Header" sx={sx}>
      <Box className="Top" sx={sx}>TOP</Box>
      <Box className="service" sx={sx}>SERVICE</Box>
      <Box className="company" sx={sx}>COMPANY</Box>
      <Box className="contact" sx={sx}>CONTACT</Box>
    </Box>
  );
};

const sx: SxProps<Theme> = {
  "&.Header" : {
    display: "flex",
    width: "100%",
    height: 60,
    borderBottom: "solid",
  },
  "&.Top" : {
    marginTop: 2.5,
    marginLeft: 120,

  },
  "&.service" : {
    marginTop: 2.5,
    marginLeft: 6,

  },
  "&.company" : {
    marginTop: 2.5,
    marginLeft: 6,

  },
  "&.contact" : {
    marginTop: 2.5,
    marginLeft: 6,
    width: "100%",

    backgroundColor: "black",
  },
};
